import React from 'react'

const One = ({thumbnail}) => (
        <li className="background-style">
                        <div className="w-30">
                            {thumbnail}
                        </div>
        </li>
)
const List = () => {
    const newsList = ['aa','bb','sds']
    return (
        <ol>
            {newsList.map( (one , index)=>(
                <One key={index} name={one} />
            ) )}

        </ol>
    )
}
export default List
